import React, { useState, useEffect } from 'react';
import { Bell, User, Star, Calendar, BookOpen } from 'lucide-react';
import logo from '../logo/nujoom-logo.png';

const Header = ({ navigateToPage, currentPage }) => {
  const [scrolled, setScrolled] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      if (window.scrollY > 10) {
        setScrolled(true);
      } else {
        setScrolled(false);
      }
    };

    window.addEventListener('scroll', handleScroll);

    // Clean up
    return () => {
      window.removeEventListener('scroll', handleScroll);
    };
  }, []);

  console.log("Current page:", currentPage); // Debug current page

  return (
    <div className="fixed top-0 left-0 right-0 w-full z-50 transition-all duration-300 bg-transparent">
      <div className="container mx-auto px-6 py-3">
        <div className="flex justify-between items-center">
          <div className="flex items-center">
            <div 
              className={`cursor-pointer flex items-center ml-8 font-bold text-xl ${
                scrolled ? 'text-[#032425]' : 'text-white'
              }`}
              onClick={() => navigateToPage('mainPage')}
            >
              نجوم
            </div>

            <nav className="flex flex-wrap">
              <div 
                className={`cursor-pointer ml-6 mb-2 ${
                  currentPage === 'playersPage' 
                    ? (scrolled ? 'text-[#032425] font-medium' : 'text-white font-medium') 
                    : (scrolled ? 'text-gray-600' : 'text-gray-300')
                }`}
                onClick={() => navigateToPage('playersPage')}
              >
                المواهب
              </div>
              <div 
                className={`cursor-pointer ml-6 mb-2 ${
                  currentPage === 'comparisons' 
                    ? (scrolled ? 'text-[#032425] font-medium' : 'text-white font-medium') 
                    : (scrolled ? 'text-gray-600' : 'text-gray-300')
                }`}
                onClick={() => navigateToPage('comparisons')}
              >
                المقارنات
              </div>
              <div 
                className={`cursor-pointer ml-6 mb-2 ${
                  currentPage === 'calendar' 
                    ? (scrolled ? 'text-[#032425] font-medium' : 'text-white font-medium') 
                    : (scrolled ? 'text-gray-600' : 'text-gray-300')
                }`}
                onClick={() => navigateToPage('calendar')}
              >
                جدول المباريات
              </div>
              <div 
                className={`cursor-pointer ml-6 mb-2 ${
                  currentPage === 'shortlistedPlayers' 
                    ? (scrolled ? 'text-[#032425] font-medium' : 'text-white font-medium') 
                    : (scrolled ? 'text-gray-600' : 'text-gray-300')
                }`}
                onClick={() => navigateToPage('shortlistedPlayers')}
              >
                اللاعبين المفضلين
              </div>
              <div 
                className={`cursor-pointer ml-6 mb-2 ${
                  currentPage === 'notes' 
                    ? (scrolled ? 'text-[#032425] font-medium' : 'text-white font-medium') 
                    : (scrolled ? 'text-gray-600' : 'text-gray-300')
                }`}
                onClick={() => {
                  console.log("Clicking on notes menu item");
                  navigateToPage('notes');
                }}
              >
                ملاحظاتي
              </div>
            </nav>
          </div>

          <div className="flex items-center">
            <button 
              className={`p-2 mr-2 ${
                currentPage === 'shortlistedPlayers' 
                  ? (scrolled ? 'text-[#032425]' : 'text-white') 
                  : (scrolled ? 'text-gray-600' : 'text-gray-300')
              }`}
              onClick={() => navigateToPage('shortlistedPlayers')}
              title="اللاعبين المفضلين"
            >
              <Star size={20} />
            </button>
            <button 
              className={`p-2 mr-2 ${
                currentPage === 'calendar' 
                  ? (scrolled ? 'text-[#032425]' : 'text-white') 
                  : (scrolled ? 'text-gray-600' : 'text-gray-300')
              }`}
              onClick={() => navigateToPage('calendar')}
              title="جدول المباريات"
            >
              <Calendar size={20} />
            </button>
            <button 
              className={`p-2 mr-2 ${
                currentPage === 'notes' 
                  ? (scrolled ? 'text-[#032425]' : 'text-white') 
                  : (scrolled ? 'text-gray-600' : 'text-gray-300')
              }`}
              onClick={() => {
                console.log("Clicking on notes icon");
                navigateToPage('notes');
              }}
              title="ملاحظاتي"
            >
              <BookOpen size={20} />
            </button>
            <button className={`p-2 mr-2 ${scrolled ? 'text-gray-600' : 'text-gray-300'}`}>
              <Bell size={20} />
            </button>
            <button className={`p-2 ${scrolled ? 'text-gray-600' : 'text-gray-300'}`}>
              <User size={20} />
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Header;
